class Solution:
    def checkInclusion(self, s1: str, s2: str) -> bool:
        storeS1 = {}
        for i in range(len(s1)):
            storeS1[s1[i]] = 1 + storeS1.get(s1[i],0)

        storeS2 = {}
        l = 0
        for r in range(len(s2)):
            storeS2[s2[r]] = 1 + storeS2.get(s2[r],0)
            
            if s2[r] in storeS1:
                while storeS2[s2[r]] > storeS1[s2[r]] or r-l+1 > len(s1):
                    storeS2[s2[l]] -= 1
                    l += 1
                else:
                    if storeS1 == storeS2: return True
            else:
                print(f'CLEARED!')
                storeS2[s2[l]] -= 1
                l += 1

        return False
    
def main():
    solution = Solution()
    print(solution.checkInclusion(
        "", ""
        ))

if __name__ == "__main__":
    main()